-- ----------------------------
--  View structure for `end_of_week`
-- ----------------------------
DROP VIEW IF EXISTS `end_of_week`;
CREATE ALGORITHM=UNDEFINED DEFINER=`hai`@`%` SQL SECURITY DEFINER VIEW `end_of_week` AS select `datedim`.`fulldate` AS `fulldate` from `datedim` where (`datedim`.`dayofweek` = 7);

-- ----------------------------
--  Procedure structure for `datedimbuild`
-- ----------------------------
DROP PROCEDURE IF EXISTS `datedimbuild`;
delimiter ;;
CREATE DEFINER=`hai`@`%` PROCEDURE `datedimbuild`(p_start_date DATE, p_end_date DATE)
BEGIN
    DECLARE v_full_date DATE;

    DELETE FROM datedim;

    SET v_full_date = p_start_date;
    WHILE v_full_date < p_end_date DO

        INSERT INTO datedim (
            fulldate ,
            dayofmonth ,
            dayofyear ,
            dayofweek ,
            dayname ,
            monthnumber,
            monthname,
            year,
            quarter
        ) VALUES (
            v_full_date,
            DAYOFMONTH(v_full_date),
            DAYOFYEAR(v_full_date),
            DAYOFWEEK(v_full_date),
            DAYNAME(v_full_date),
            MONTH(v_full_date),
            MONTHNAME(v_full_date),
            YEAR(v_full_date),
            QUARTER(v_full_date)
        );

        SET v_full_date = DATE_ADD(v_full_date, INTERVAL 1 DAY);
    END WHILE;
END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `test`
-- ----------------------------
DROP PROCEDURE IF EXISTS `test`;
delimiter ;;
CREATE DEFINER=`hai`@`%` PROCEDURE `test`(dayselected date)
BEGIN


SET @sql = CONCAT('SELECT DATE("',dayselected,'" + INTERVAL (7 - DAYOFWEEK("',dayselected,'")) DAY)');

PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END
 ;;
delimiter ;

